import React,{ useState, useEffect } from 'react';
import axios from 'axios';
import { useRefresh } from '../context/RefreshContext';
import { useUserContext } from '../context/UserContext';

const EventList = () => {
  
  const [events, setEventList] = useState([]);
  const { refreshEventList, setRefreshEventList } = useRefresh();
  const [isJoinMessage, setIsJoinMessage] = useState('Join'); // Corrected state variable name
  const { UserId } = useUserContext();

  console.log("Eventlist",events);

  useEffect(() => {
    axios.get('/api/getevents')
      .then(response => {
        setEventList(response.data);
      })
      .catch(error => {
        console.error('Error fetching event list:', error);
      });
  }, [refreshEventList, setRefreshEventList]);

  useEffect(() => {
    handleJoined();
  }, [events, UserId]);

  const handleJoined = () => {
    console.log("Event Joined 1");
    let joined = false; 
    for (const event of events) {
      console.log("Event Joined 2");
      console.log(event);
      console.log("Handle Joined--->" + event.organizer + ' ' + UserId);
      if (event.organizer === UserId) {
        console.log("Match found! Organizer: " + event.organizer + ", User ID: " + UserId);
        setIsJoinMessage('Joined');
        joined = true;
        break; // Exit the loop once a match is found
      }
    }
  
    if (!joined) {
      console.log("No match found.");
      setIsJoinMessage('Join');
    }
  }

  return (
    <div className='eventlistmain'>
      <h3 className='explore'>Explore Events</h3>
      <ul className='eventlist'>   
                {events.map(event => (
                    <li className='eventitem card' key={event._id} >
                         <div className="eventhead">
                         <div className="eventtitle">
                          <h2>{event.name}</h2>
                        </div>
                        <div className='joined'>
                           <img src="data:image/png;base64," />
                         <span>{event.joined > 0 ? event.joined : 0}</span>
                         </div>
                        </div>
                        <div className="eventmid">
                        <p>Category: {event.category}</p>
                        <p>Location: {event.location}</p>
                        <p>Date: {event.date}</p>
                        <p>Time: {event.startTime} - {event.endTime}</p>
                        <p className='desc'>Description: {event.description}</p>
                        <p>Attendees: {event.attendees}</p>
                        <p>Organizer: {event.organizerName}</p>
                        </div>
                        <div className="btn">
                          <button>{isJoinMessage}</button>
                          <button className='moreinfobtn'>More Info</button>
                        </div>
                    </li>
                ))}
            </ul>
    </div>
  );
};

export default EventList;
